import  React, {Component} from 'react';

import './Header.css';


export default class Header extends Component{
    render(){

        return(

          <div className = "nav_bar">
              <p id = 'pos_a'>{this.props.bar}</p>
              <p id = 'pos_b'>Nandana Lekshmi Deepu</p>
              <p id = 'pos_c'>Albums</p>
              <p id = 'pos_d'>Sign Out</p>
          </div>
        );

    }
}
